import React, { Component } from 'react';

class Konstituen extends Component {
   constructor() {
      super()

   }
   render() {
      return (
         <div>
            <h1>Data Konstituen</h1>
            <table className="table">
               <thead>
                  <th>Nama</th>
                  <th>NIK</th>
                  <th>Alamat</th>
                  <th>Kecamatan</th>
                  <th>Kelurahan</th>
                  <th>Nomor TPS</th>
               </thead>
               <tbody>
                  <tr>
                     <td></td>
                  </tr>
               </tbody>
            </table>
         </div>
      )
   }
}

export default Konstituen;
